INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("春咲 ひより", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1, 0, 1, 0, 1, 2, "お！\nあそこに困ってそうな人発見！", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("草野 優衣", 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1, 0, 1, 0, 1, 2, "大切な人を\n守れるようになりたい…って", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("士条 怜", 0, "フェンシングを始めてみては？", 0, 1003, "少しは磨かれると思いますよ。", 0, 1, 0, 1, 0, 1, 2, "キミに必要な集中力と感性が", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("穂高 みそぎ", 0, "ねぇ、にいちゃん！", 0, 1004, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1, 0, 1, 0, 1, 2, "今日はなにして遊ぶ？", 1.5);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("風宮 あかり", 0, "風宮あかりです", 0, 1006, "私といっしょに…\nいかない？", 0, 1, 0, 1, 0, 1, 2, "ねぇ…", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("出雲 宮子", 0, "出雲宮子なのー", 0, 1007, "食べ物の恨みは怖いのー", 0, 1, 0, 1, 0, 1, 2, "プリンたべたいのー", 1.5);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("虹村 雪", 0, "ボクは虹村雪。", 0, 1008, "いいよ。\n見られることは運命さ…", 0, 1, 0, 1, 0, 1, 2, "キミもボクの美貌に\n吸い寄せられたんだね。", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("柊杏奈", 0, "フッ…聞いて後悔するがいい！", 0, 1009, "人呼んで「疾風の冥姫」!!", 0, 1, 0, 1, 0, 1, 2, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("姫宮 真歩", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1010, "ほんまおおきにやわ～♪", 0, 1, 0, 1, 0, 1, 2, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1.5);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("衣之咲 璃乃", 0, "衣之咲璃乃です！", 0, 1011, "ここで会ったが\n100年目～！", 0, 1, 0, 1, 0, 1, 2, "生き別れたお兄ちゃんを探して\n三千世界！", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("柏崎 初音", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1012, "…って、お願い！\n誰にも言わないでおいて～！", 0, 1, 0, 1, 0, 1, 2, "ち、超能力って…\n何のことかな～？", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("美波 鈴奈", 0, "ちょす！\n美波鈴奈だよ～♪", 0, 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1, 0, 1, 0, 1, 2, "一応カリスマ読モJKやってまっす！", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("喜屋武 香織", 0, "はいたーい。\n喜屋武香織さー。", 0, 1017, "でも、沖縄もとってもいいとこさー", 0, 1, 0, 1, 0, 1, 2, "東京は遊園地みたいなところさー", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("支倉 伊緒", 0, "支倉伊緒です。", 0, 1018, "イオちゃんって呼んでね。", 0, 1, 0, 1, 0, 1, 2, "先生って呼ばれるのは\nくすぐったいから", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("茜 ミミ", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1020, "ミミをおいてかないでぇ～", 0, 1, 0, 1, 0, 1, 2, "あ！/\お兄ちゃ～ん\nまってよ～", 1.5);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("栗林 くるみ", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1021, "ふぇぇぇぇぇん……", 0, 1, 0, 1, 0, 1, 2, "あの……\nふぇ……", 1.5);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("風宮 より", 0, "風宮よりです。\nあああああ！", 0, 1022, "なんてありがとうございます！", 0, 1, 0, 1, 0, 1, 2, "こんな私に貴重な時間を\n割いていただき、", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("北条 綾音", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1023, "私こっち行きたいー\nね、早く早くー", 0, 1, 0, 1, 0, 1, 2, "おにいちゃんどこいくの？\nえ？", 1.5);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("天野 すずめ", 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 1025, "これて何か違う…\nあああすみません！", 0, 1, 0, 1, 0, 1, 2, "ふ、不束者ですが\nどうぞ末永く…って、", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("倉石 恵理子", 0, "……クスクス…私は\n…倉石恵理子……", 0, 1027, "離しませんわ………\n絶対に…!!", 0, 1, 0, 1, 0, 1, 2, "あなたは…運命の……\n伴侶……", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("佐々木 咲恋", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1028, "…そうでしょ？？", 0, 1, 0, 1, 0, 1, 2, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("桜井 望", 0, "桜井望だよ！\nよろしくねっ", 0, 1029, "あはは、\n私もまだまだだなぁ～", 0, 1, 0, 1, 0, 1, 2, "ぇっと…\nキミ、私のこと知らないの?!", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("ニノン・ジュベール", 0, "デケデケデンっ！", 0, 1030, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1, 0, 1, 0, 1, 2, "初めまして、\n私はニノン・ジュベール申すデス！", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("上喜 しのぶ", 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 1031, "おかしいですね……", 0, 1, 0, 1, 0, 1, 2, "でもって私の隣にいるのが……\nえ、見えない？", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("野戸まひる", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1033, "そう、\nオラのボケに突っ込める相方が…！", 0, 1, 0, 1, 0, 1, 2, "けんども\nそれには足りないモンが…", 1.5);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("綾瀬 ゆかり", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1034, "ちょ\nちょっと一杯飲んできます…！", 0, 1, 0, 1, 0, 1, 2, "ちょっと緊張しちゃって…", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("氷川 鏡華", 0, "氷川鏡華…です", 0, 1036, "これ以上お話しすることは…\nないです！", 0, 1, 0, 1, 0, 1, 2, "知らない人とは話しちゃいけないので", 1.5);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("柏崎 栞", 0, "柏崎…栞です。", 0, 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1, 0, 1, 0, 1, 2, "……あ、アラーム。", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("双葉 碧", 0, "ふ、双葉碧です。", 0, 1040, "野に咲く花が、\n唯一の話相手です。", 0, 1, 0, 1, 0, 1, 2, "私、一人も友達がいなくて……", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("三角 千歌", 0, "三角千歌です。", 0, 1042, "そう思っています。", 0, 1, 0, 1, 0, 1, 2, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("安芸 真琴", 0, "安芸真琴だ。", 0, 1043, "う、疑ってすまなかったな…", 0, 1, 0, 1, 0, 1, 2, "あぁ？\nお前のそいつの仲間か？", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("イリヤ・オーンスタイン", 0, "わらわこそは夜を総べる者！", 0, 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1, 0, 1, 0, 1, 2, "生けとし生ける全ての者よ！", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("遠見 空花", 0, "そこで騎士は妖精を乱暴に……", 0, 1045, "ｌク、クウカに何かご用ですか!?", 0, 1, 0, 1, 0, 1, 2, "ぐふふふふ……はっ！", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("宮坂たまき", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1046, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1, 0, 1, 0, 1, 2, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("大神 美冬", 0, "大神美冬よ！", 0, 1048, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1, 0, 1, 0, 1, 2, "それでは早速クエストに…", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("星野静流", 0, "星野静流だよ！", 0, 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1, 0, 1, 0, 1, 2, "クエストもバトルも\n掃除も洗濯も", 1.4);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("玉泉美咲", 0, "アタシは玉泉美咲。", 0, 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1, 0, 1, 0, 1, 2, "見ての通りの\nセクシー美少女で", 1.5);
